import React from "react";
import "./Styles.css";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation";
import { Navigation } from "swiper/modules";

const Videoplayer = () => {
    return (
        <div>
            <div className="video-content">Hướng Dẫn Sử Dụng Sản Phẩm</div>
            <Swiper
                navigation={true}
                modules={[Navigation]}
                loop
                className="mySwiper"
            >
                <SwiperSlide>
                    <div className="video">
                        <video
                            style={{ width: 900, height: 500 }}
                            src=""
                            autoPlay={true}
                            muted={true}
                        ></video>
                    </div>
                </SwiperSlide>
                <SwiperSlide>
                    <div className="video">
                        <video
                            style={{ width: 900, height: 500 }}
                            src=""
                            autoPlay={true}
                            muted={true}
                        ></video>
                    </div>
                </SwiperSlide>
                <SwiperSlide>
                    <div className="video">
                        <video
                            style={{ width: 900, height: 500 }}
                            src="./video.mp4"
                            autoPlay={true}
                            muted={true}
                        ></video>
                    </div>
                </SwiperSlide>
                <SwiperSlide>
                    <div className="video">
                        <video
                            style={{ width: 900, height: 500 }}
                            src="./video.mp4"
                            autoPlay={true}
                            muted={true}
                        ></video>
                    </div>
                </SwiperSlide>
            </Swiper>
        </div>
    );
};

export default Videoplayer;
